# Generates the walks (for illustration only).
C = str.count
def aGen(n: int) -> Generator[str, Any, list[str]]:
    a = [""]
    if n <= 0: return a
    for w in a:
        if len(w) == n - 1:
            if C(w, "N") > 0 and C(w, "N") == C(w, "S"):
                yield w
        else:
            for j in "NSEW":
                U = w + j
                if C(U, "N") >= C(U, "S"):
                    a += [U]
    return a
for n in range(6): print([w for w in aGen(n)])  # _Peter Luschny_, Dec 03 2024

